style.css:
/* Set a navy blue background with a silver text color for the entire page */
body, html {
    background-color: #001f3f !important; /* Navy */
    color: #C0C0C0 !important; /* Silver */
}

/* Set background and text color for all divs, sections, and articles */
div, section, article {
    background-color: #001f3f !important;
    color: #C0C0C0 !important;
}

/* Ensure form inputs and buttons match the aesthetic */
input, textarea, select, button {
    background-color: #001f3f !important;
    color: #C0C0C0 !important;
    border: 1px solid #C0C0C0 !important;
}
